    return (
        <>
            <Header />
            <div className='container-fluid'>
                <div class="my-3 p-3 bg-body rounded shadow-sm">
                    <h3 class="border-bottom pb-2 mb-0">Register your Business Profile</h3>
                    
                   
                </div>
            </div>

        </>
    )
}

export default Invoice
